import { NavLink } from 'react-router-dom';

function Header() {
  return (
    <header style={styles.header}>
      <h2>⚡ Phone Catalog</h2>

      <nav style={styles.nav}>
        <NavLink to="/" style={styles.link}>Home</NavLink>
        <NavLink to="/phones" style={styles.link}>Phones</NavLink>
        <NavLink to="/tablets" style={styles.link}>Tablets</NavLink>
        <NavLink to="/accessories" style={styles.link}>Accessories</NavLink>
        <NavLink to="/cart" style={styles.link}>Cart</NavLink>
        <NavLink to="/favorites" style={styles.link}>Favorites</NavLink>
      </nav>
    </header>
  );
}

const styles = {
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '16px',
    borderBottom: '1px solid #ccc',
  },
  nav: {
    display: 'flex',
    gap: '12px',
  },
  link: {
    textDecoration: 'none',
    color: 'black',
    fontWeight: '500',
  },
};

export default Header;
